import React from "react";
import {
  FormAutoComponent,
  FormUsuarioComponent,
  TableAutoComponent,
  TableUsuarioComponent,
  ButtonComponents,
} from "../components";

const HomePage = () => {
  return (
    <div class="has-bg-img">
      <img class="bg-img" src="../Assets/IMG/volvo.jpg" alt="no carga"></img>

      <div>
        <FormAutoComponent />
        <br />
        <FormUsuarioComponent />
        <br />
        <TableAutoComponent />
        <ButtonComponents />
        <br />
        <TableUsuarioComponent />
        <ButtonComponents />
        <br />
      </div>
    </div>
  );
};
export default HomePage;
